function Home(props) {
  return (
    <div className="container">
        <p className="name-text">
          Hi, I'm Michael Bubel.
        </p>
        <p className="bio-text">I'm currently enrolled in the UCSD Full Stack Development Program <br>and projected to graduate in March of 2021.</br></p>
    </div>
  );
}

export default Home;
